import React from "react";
import { Nav, Navbar } from "react-bootstrap";

const myNavbar = () => (
	<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
		<Navbar.Brand href="#home">Dice Roller</Navbar.Brand>
		<Navbar.Toggle aria-controls="responsive-navbar-nav" />
		<Navbar.Collapse id="responsive-navbar-nav">
			<Nav className="mr-auto">
				<Nav.Link href="/">Promotions</Nav.Link>
				<Nav.Link href="/category/1">Winter Offer</Nav.Link>
				<Nav.Link href="/category/2">Spring Offer</Nav.Link>
				<Nav.Link href="/category/3">Autum Offer</Nav.Link>
			</Nav>
		</Navbar.Collapse>
	</Navbar>
);

export default myNavbar;
